import React from "react";
import { Box, InputLabel, TextField, Typography } from "@mui/material";

const AddBlog = () => {
  return (
    <div>
      <form>
        <Box
          display={"flex"}
          flexDirection="column"
          width={"80%"}
          border={3}
          borderColor="#ccc"
          borderRadius={8}
          boxShadow="10px 10px 20px #ccc"
          padding={3}
          margin={3}
        >
          <Typography variant="h4" fontWeight={"bold"} marginBottom={2}>
            Post your Blog
          </Typography>
          <InputLabel sx={{ mb: 1, fontSize: "24px", fontWeight: "bold" }}>
            Title
          </InputLabel>
          <TextField />
          <InputLabel sx={{ mb: 1, fontSize: "24px", fontWeight: "bold" }}>Description</InputLabel>
          <TextField />
          <InputLabel>ImageURL</InputLabel>
          <TextField />
        </Box>
      </form>
    </div>
  );
};

export default AddBlog;
